import React from 'react';
import './HomePageBody.css';
import Button from "@material-ui/core/Button";
import {Card} from 'react-bootstrap';
import Comp from './Comp.jpg';
import Inter from './Interviwee.jpg';


function HomePageBody() {
const cardInfo = [
    { image:{Comp} , title:"" , text:"INTERVIWEE LOGIN" } ,
    { image:{Inter} , title:"" , text:"COMPANY LOGIN" } ,
];


const renderCard = (card, index) => {
    return(
        <Card style={{ width: '18rem' }} key={index}>
        <Card.Img variant="top" src={require('./Comp.jpg')} />
        <Card.Body>
          <Card.Title>{card.title}</Card.Title>
         <div className='button'>
          <Button variant="primary">{card.text}</Button>
          </div>
        </Card.Body>
      </Card>
    )
}

    return (
    <div className={'home'}>
  

        <div class="webname">
            <div class="head">
              <h1 class="header">(Interwiew Website Name)</h1>
              <div className='grid'>{cardInfo.map(renderCard)}</div>
            </div>
       </div>
       
    </div>
     
        
    )
}

export default HomePageBody
